import React, {Component} from 'react'
import DataTable from 'react-data-table-component';

// const data = [{ id: 1, title: 'Conan the Barbarian', year: '1990'},{ id: 2, title: 'Conan the Barbarian', year: '1982' }];
const columns = [
  {
    name: 'Title',
    selector: 'title',
    sortable: true,
  },
  {
    name: 'Game Id',
    selector: 'year',
    sortable: true,
    right: true,
  },
];


class MyComponent extends Component {

  render() {
  	const data = this.props.data.map((contest, id) => {
  		return (
  			{title: contest.title, game_id: contest.unique_contest_id, id}
  		)
  	})

    return (
      <DataTable
        // title="Arnold Movies"
        columns={columns}
        data={data}
      />
    )
  }
};

export default MyComponent
